import React from 'react';
const SlotM=(props)=>{
  let x= props.x;
  let y= props.y;
  let z= props.z;
  
  if(x===y && x===z){
    return(
      <>
      <div className='slot_inner'>
      <h1>
      {x} {y} {z}</h1>
      <h1>This is Matching</h1>
      <hr/>
      </div>
      </>
    )
  }
  else{
    return(
      <>
      <div className='slot_inner'>
      <h1>
      {x} {y} {z}</h1>
      <h1>This is not Matching</h1>
      <hr/>
      </div>
      </>
    )

  }
}


const App= ()=>{
  return( 
  <>
  <h1 className='heading_style'>slot Welcome to
   <span style={{fontWeight: "bold"}}>Slot machine game</span>
   </h1>
   <div className='slotmachine'>
   <SlotM x= ':smile' y=":cry" z=":smile"  />
   <SlotM  x= ':smile' y=":smile" z=":weep"/>
   <SlotM  x= ':weep' y="weep" z=":weep"/>
   <SlotM  x= ':smile' y=":laugh" z=":weep"/>
   <SlotM  x= ':rose' y=":rose" z=":weep"/>
   </div>

   
  </>
  );
};

export default App;
